---
studyInfo:
  id: ssnl_ema_fall_2022_study
  startDate: 2022-10-31T02:00:00Z
  endDate: 2022-11-21T02:00:00Z
  version: a
  studyFileURL: https://wellping.communitiesproject.stanfordsnl.org/studyFile
  consentFormUrl: https://docs.google.com/document/d/e/2PACX-1vR-PN2uJ7DfnX--klfDrLS_z-3bM12KsX8RpvkvybCNuK4h2iNRC3PuP7o5q8KXsg6dXlkK82cagB5P/pub
  # update this
  contactEmail: communitiesproject@stanford.edu
  dashboardURL: https://wellping.communitiesproject.stanfordsnl.org/ssnl_dashboard?username=__USERNAME__&password=__PASSWORD_HASH__&device_id=__LOGIN_SESSION_ID__&timezone_offset=__TIMEZONE_OFFSET__&pings_completed_this_week=__PINGS_COMPLETED_THIS_WEEK__
  server:
    beiwe:
      serverUrl: https://wellping.communitiesproject.stanfordsnl.org
  weekStartsOn: 1
  pingsFrequency:
    - earliestPingNotificationTime: "09:00:00"
      latestPingNotificationTime: "10:59:59"
      expireAfterTime: "02:00:00"
    - earliestPingNotificationTime: "13:00:00"
      latestPingNotificationTime: "14:59:59"
      expireAfterTime: "02:00:00"
    - earliestPingNotificationTime: "17:00:00"
      latestPingNotificationTime: "18:59:59"
      expireAfterTime: "02:00:00"
    - earliestPingNotificationTime: "21:00:00"
      latestPingNotificationTime: "22:59:59"
      expireAfterTime: "02:00:00"
  streamsStartingQuestionIds:
    welcomeStream: familyIncome
    modalStream: affHappy
    sleepModalStream: sleepQuality
  streamsOrder:
    "0": &everyday-order
      - sleepModalStream
      - modalStream
      - modalStream
      - modalStream
    "1": *everyday-order
    "2": *everyday-order
    "3": *everyday-order
    "4": *everyday-order
    "5": *everyday-order
    "6": *everyday-order
  streamsForNthPings:
    "1": welcomeStream
  streamInCaseOfError: modalStream
  streamsNotReplacedByFollowupStream: []
  notificationContent:
    default:
      title: You have a new survey!
      body: It will expire in two hours.
  specialVariablePlaceholderTreatments:
    TARGET_CATEGORY:
      decapitalizeFirstCharacter:
        enabled: true

streams:
  modalStream: &modal-stream
    affHappy: &feel-current-instance
      id: affHappy
      type: Slider
      question: Please use the slider bar to indicate how you feel right now.
      slider:
        - not at all happy
        - extremely happy
      next: affSad
    affSad:
      <<: *feel-current-instance
      id: affSad
      slider:
        - not at all sad
        - extremely sad
      next: affAngry
    affAngry:
      <<: *feel-current-instance
      id: affAngry
      slider:
        - not at all angry
        - extremely angry
      next: wbStress

    # WELL-BEING
    wbStress:
      <<: *feel-current-instance
      id: wbStress
      slider:
        - not at all stressed
        - extremely stressed
      next: wbLonely
    wbLonely:
      <<: *feel-current-instance
      id: wbLonely
      slider:
        - not at all lonely
        - extremely lonely
      next: wbOptimistic
    wbOptimistic:
      <<: *feel-current-instance
      id: wbOptimistic
      slider:
        - not at all optimistic
        - extremely optimistic
      next: wbAnxious
    wbAnxious:
      <<: *feel-current-instance
      id: wbAnxious
      slider:
        - not at all anxious
        - extremely anxious
      next: wbDepressed
    wbDepressed:
      <<: *feel-current-instance
      id: wbDepressed
      slider:
        - not at all depressed
        - extremely depressed
      next: wbEngaged
    wbEngaged:
      <<: *feel-current-instance
      id: wbEngaged
      slider:
        - not at all engaged
        - extremely engaged
      next: activity

    # ACTIVITY
    activity:
      id: activity
      type: ChoicesWithSingleAnswer
      question: During the past hour, what was your primary activity?
      choices:
        - Attending classes / meetings
        - In transit / running errands
        - Eating / drinking
        - Exercising / physical activity
        - Sleeping / resting / napping
        - Meditate
        - Studying
        - Working at a job
        - Socializing / partying
        - Digital entertainment (games / movies)
        - Social media (internet / apps)
        - Other
      randomizeChoicesOrder: true
      randomizeExceptForChoiceIds:
        - Other
      next: location
    location:
      id: location
      type: ChoicesWithSingleAnswer
      question: During the past hour, what was your primary location?
      choices:
        - My home / dormitory
        - Cafe / Restaurant / Bar
        - Classroom / Lecture Hall
        - Other’s home / dormitory
        - Gym
        - Library
        - Store / Mall
        - Work
        - Vehicle
        - Outdoors
        - Other
      randomizeChoicesOrder: true
      randomizeExceptForChoiceIds:
        - Other
      next: socialMediaActive
    socialMediaActive: &social-media-instance
      id: socialMediaActive
      type: ChoicesWithSingleAnswer
      question: During the past hour, how much time did you spend actively liking, posting, commenting, or sharing content on social media?
      choices:
        - No time at all
        - Too little time
        - The right amount of time
        - Too much time
      next: socialMediaPassive
    socialMediaPassive:
      <<: *social-media-instance
      id: socialMediaPassive
      question: During the past hour, how much time did you spend passively browsing content on social media?
      next: socMediaFeelConnected
    
    # SOCIAL MEDIA REASONS
    socMediaFeelConnected: &social-media-reason-instance
      id: socMediaFeelConnected
      type: Slider
      question: To what extent did you use social media to feel connected with people in the past hour?
      slider:
        - Completely Untrue
        - Completely True
      minimumValue: 1
      maximumValue: 7
      step: 1
      defaultValue: 4
      next: socMediaFriendship
    socMediaFriendship:
      <<: *social-media-reason-instance
      id: socMediaFriendship
      question: To what extent did you use social media to form and/or maintain friendships in the past hour?
      next: socMediaProfessional
    socMediaProfessional:
      <<: *social-media-reason-instance
      id: socMediaProfessional
      question: To what extent did you use social media to make and/or maintain professional connections in the past hour?
      next: socMediaJobsCareers
    socMediaJobsCareers:
      <<: *social-media-reason-instance
      id: socMediaJobsCareers
      question: To what extent did you use social media to learn about possible jobs and careers in the past hour?
      next: socMediaLifestyles
    socMediaLifestyles:
      <<: *social-media-reason-instance
      id: socMediaLifestyles
      question: To what extent did you use social media to learn about possible lifestyles in the past hour?
      next: socMediaValues
    socMediaValues:
      <<: *social-media-reason-instance
      id: socMediaValues
      question: To what extent did you use social media to explore your goals, beliefs, and values in the past hour?
      next: socMediaPlatforms
    socMediaPlatforms:
      id: socMediaPlatforms
      type: ChoicesWithMultipleAnswers
      question: Which social media platforms did you use for these reasons during the past hour? (Select all that apply)
      choices:
        - Facebook
        - Instagram
        - LinkedIn
        - Pinterest
        - Reddit
        - Snapchat
        - TikTok
        - Twitter
        - WhatsApp
        - YouTube
        - Other
        - Not applicable, I did not use social media
      next: socialRiskTaking

    # SOCIAL RISK-TAKING
    socialRiskTaking:
      id: socialRiskTaking
      type: ChoicesWithMultipleAnswers
      question: In the past hour, have you done any of the following? Select all that apply.
      choices:
        - Open up to other students when you were struggling
        - Share bad news with friends
        - Go to a social gathering where you did not know anybody
        - Initiate a conversation with another student that you didn't already know
        - Defend an unpopular opinion that you believed in
        - None of the above
      next: SU_Nom

    # SOCIAL
    ## STANFORD UNDERGRADS

    ##### MODIFICATIONS BELOW

    SU_Nom: &SU-nomination
      id: SU_Nom
      type: MultipleText
      question: During the past hour, did you socialize with any Stanford undergraduates in-person? (max 6)
      extraCustomNextWithoutAnsweringButton: No Interactions
      placeholder: Enter a name…
      dropdownChoices:
        choices: NAMES
        forceChoice: true
      max: 6
      variableName: TARGET_NAME
      indexName: INDEX
      # repeatedItemStartId: SU[__INDEX__]_Rel
      fallbackNext:
        nextWithoutAnswering: SU_Digital_Nom_None_In_Person
        preferNotToAnswer: SU_Digital_Nom_None_In_Person
      next: SU_Digital_Nom
    SU_Digital_Nom: &SU-digital-nomination
      <<: *SU-nomination
      id: SU_Digital_Nom
      question: During the past hour, did you socialize with any Stanford undergraduates via digital media (e.g., social media, calls, texts)? (max 6)
      fallbackNext:
        nextWithoutAnswering: SU_Most_Meaningful
        preferNotToAnswer: SU_Most_Meaningful
      # not sure if those are needed ^
      next: SU_Most_Meaningful
    SU_Digital_Nom_None_In_Person:
      <<: *SU-digital-nomination
      id: SU_Digital_Nom_None_In_Person
      fallbackNext:
        nextWithoutAnswering: SU_Nom_None_lastMeaningful
        preferNotToAnswer: SU_Nom_None_lastMeaningful
      next: SU_Most_Meaningful
    SU_Most_Meaningful: &SU-most-meaningful
      id: SU_Most_Meaningful
      type: MultipleText
      question: Which of these interactions (both in person and online) was the MOST meaningful? (max 1)
      placeholder: Enter a name…
      dropdownChoices:
        choices: NAMES
        forceChoice: true
      variableName: TARGET_NAME
      indexName: INDEX
      repeatedItemStartId: SU[__INDEX__]_Rel
      fallbackNext:
        nextWithoutAnswering: generalRel
        preferNotToAnswer: generalRel
      max: 1
      next:
    SU_Nom_None_lastMeaningful:
      id: SU_Nom_None_lastMeaningful
      type: ChoicesWithSingleAnswer
      question: When did you last have an interaction with a Stanford undergraduate?
      choices:
        - 1-6 hours ago
        - 6-12 hours ago
        - More than 12 hours ago
      next: SU_Nom_None_Nom
    SU_Nom_None_Nom:
      <<: *SU-nomination
      id: SU_Nom_None_Nom
      question: Think back to your last interaction(s) with a Stanford undergraduate(s). Please nominate the student(s) you had interactions with in-person. (max 6)
      fallbackNext:
        nextWithoutAnswering: SU_Nom_None_Digital_Nom_None_In_Person
        preferNotToAnswer: SU_Nom_None_Digital_Nom_None_In_Person
      next: SU_Nom_None_Digital_Nom
    SU_Nom_None_Digital_Nom: &SU-none-digital-nomination
      <<: *SU-digital-nomination
      id: SU_Nom_None_Digital_Nom
      question: Think back to your last interaction(s) with a Stanford undergraduate(s). Please nominate the student(s) you had interactions with via digital media (e.g., social media, calls, texts). (max 6)
      fallbackNext:
        nextWithoutAnswering: SU_Nom_None_Most_Meaningful
        preferNotToAnswer: SU_Nom_None_Most_Meaningful
        # might not be required
      next: SU_Nom_None_Most_Meaningful
    SU_Nom_None_Digital_Nom_None_In_Person: 
      <<: *SU-none-digital-nomination
      id: SU_Nom_None_Digital_Nom_None_In_Person
      # change below to send to general stream if no, otherwise continue with no su interaction stream
      fallbackNext:
        nextWithoutAnswering: generalRel
        preferNotToAnswer: generalRel
      next: SU_Nom_None_Most_Meaningful
    SU_Nom_None_Most_Meaningful:
      <<: *SU-most-meaningful
      id: SU_Nom_None_Most_Meaningful
      next:
    SU[__INDEX__]_Rel:
      id: SU[__INDEX__]_Rel
      type: ChoicesWithSingleAnswer
      question: How would you best describe your relationship to [__TARGET_NAME__]?
      choices:
        - Friend
        - Classmate
        - Co-worker
        - Teammate (athletic / extracurricular)
        - Dormmate / roommate
        - Significant other
        - House staff
        - Other
      randomizeChoicesOrder: true
      randomizeExceptForChoiceIds:
        - Other
      defaultPlaceholderValues: &SU-defaultPlaceholderValues
        INDEX: RECENT
        TARGET_NAME: a recent interaction partner
      next: SU[__INDEX__]_platform
    SU[__INDEX__]_platform: &target-interaction-instance
      id: SU[__INDEX__]_platform
      type: ChoicesWithSingleAnswer
      question: How did the interaction with [__TARGET_NAME__] take place?
      choices:
        - In person
        - Over the phone
        - Video call
        - Direct messaging
        - Social media post (e.g. Snapchat story, Instagram post)
        - Other
      randomizeChoicesOrder: true
      randomizeExceptForChoiceIds:
        - Other
      defaultPlaceholderValues:
        <<: *SU-defaultPlaceholderValues
      next: SU[__INDEX__]_emp
    SU[__INDEX__]_emp: &target-empathic-instance
      id: SU[__INDEX__]_emp
      type: ChoicesWithSingleAnswer
      question: How supportive / empathic was [__TARGET_NAME__] towards YOU in the interaction?
      choices:
        - Not at all
        - Not very
        - Somewhat
        - Very
        - Extremely
      defaultPlaceholderValues:
        <<: *SU-defaultPlaceholderValues
      next: SU[__INDEX__]_sourceEmp
    SU[__INDEX__]_sourceEmp:
      <<: *target-empathic-instance
      id: SU[__INDEX__]_sourceEmp
      question: How supportive / empathic were YOU towards [__TARGET_NAME__] in the interaction?
      defaultPlaceholderValues:
        <<: *SU-defaultPlaceholderValues
      next:

    # GENERAL STREAM (NO NOMINATIONS)
    generalRel:
      id: generalRel
      type: ChoicesWithSingleAnswer
      question: How would you best describe your relationship to a recent Stanford Undergraduate interaction partner?
      choices:
        - Friend
        - Classmate
        - Co-worker
        - Teammate (athletic / extracurricular)
        - Dormmate / roommate
        - Significant other
        - House staff
        - Other
      randomizeChoicesOrder: true
      randomizeExceptForChoiceIds:
        - Other
      defaultPlaceholderValues: #&SU-defaultPlaceholderValues
        INDEX: RECENT
        TARGET_NAME: a recent interaction partner
      next: generalPlatform
    generalPlatform: 
      id: generalPlatform
      type: ChoicesWithSingleAnswer
      question: How did the interaction with a recent Stanford Undergraduate interaction partner take place?
      choices:
        - In person
        - Over the phone
        - Video call
        - Direct messaging
        - Social media post (e.g. Snapchat story, Instagram post)
        - Other
      randomizeChoicesOrder: true
      randomizeExceptForChoiceIds:
        - Other
      defaultPlaceholderValues:
        <<: *SU-defaultPlaceholderValues
      next: generalEmp
    generalEmp: &general-empathic-instance
      id: generalEmp
      type: ChoicesWithSingleAnswer
      question: How supportive / empathic was a recent Stanford Undergraduate interaction partner towards YOU in the interaction?
      choices:
        - Not at all
        - Not very
        - Somewhat
        - Very
        - Extremely
      defaultPlaceholderValues:
        <<: *SU-defaultPlaceholderValues
      next: generalSourceEmp
    generalSourceEmp:
      <<: *general-empathic-instance
      id: generalSourceEmp
      question: How supportive / empathic were YOU towards a recent Stanford Undergraduate interaction partner in the interaction?
      # defaultPlaceholderValues:
      #   <<: *SU-defaultPlaceholderValues
      next:


