  ### PLACE HOLDER ^^^

  # SLEEP QUESTIONS STREAM
  sleepModalStream: &sleep-modal-stream
    sleepQuality:
      id: sleepQuality
      type: ChoicesWithSingleAnswer
      question: How well did you sleep last night?
      choices:
        - Poor
        - Below average
        - Average
        - Above average
        - Excellent
      next: sleepHours
    sleepHours:
      id: sleepHours
      type: ChoicesWithSingleAnswer
      question: How many hours did you sleep last night?
      choices:
        - 0 hours
        - 1 hour
        - 2 hours
        - 3 hours
        - 4 hours
        - 5 hours
        - 6 hours
        - 7 hours
        - 8 hours
        - 9 hours
        - 10 hours
        - 11 hours
        - 12 hours
        - 13 hours
        - 14 hours
        - 15 hours
        - 16 hours
      next: affHappy
    <<: *modal-stream

  welcomeStream:
    # DEMOGRAPHICS
    familyIncome:
      id: familyIncome
      type: ChoicesWithSingleAnswer
      question: What is your annual household income in US dollars?
      choices:
        - $0-$20,000
        - $20,001-$40,000
        - $40,001-$60,000
        - $60,001-$80,000
        - $80,001-$100,000
        - $100,001-$120,000
        - $120,001-$140,000
        - $140,001-$160,000
        - $160,001-$180,000
        - $180,001-$200,000
        - $200,001-$250,000
        - $250,001-$300,000
        - $300,001-$350,000
        - $350,001-$400,000
        - $400,001-$450,000
        - $450,001-$500,000
        - Over $500,000
      next: ladderUS
    ladderUS: &ladder-instance
      id: ladderUS
      type: MultipleText
      question: Think of this ladder as representing where people stand in the United States.
